  "qa1_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Trang web c\xF3 mi\u1EC5n ph\xED kh\xF4ng?" } },
  "qa1_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Kh\xF4ng ho\xE0n to\xE0n mi\u1EC5n ph\xED. \u0110\u1EC3 ph\xE1t tri\u1EC3n l\xE2u d\xE0i, ph\xED trong t\u01B0\u01A1ng lai l\xE0 kh\xF4ng th\u1EC3 tr\xE1nh kh\u1ECFi, nh\u01B0ng s\u1EBD kh\xF4ng y\xEAu c\u1EA7u thanh to\xE1n \u0111\u1EC3 s\u1EED d\u1EE5ng. Ch\xFAng t\xF4i c\u1ED1 g\u1EAFng t\xECm s\u1EF1 c\xE2n b\u1EB1ng gi\u1EEFa mi\u1EC5n ph\xED v\xE0 tr\u1EA3 ph\xED." } },
  "qa1_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "D\u1EF1 \xE1n l\xE0 m\xE3 ngu\u1ED3n m\u1EDF, b\u1EA1n c\xF3 th\u1EC3 t\u1EF1 tri\u1EC3n khai." } },
  "qa2_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Kh\xF4ng th\u1EC3 nh\u1EADp, b\xE0n ph\xEDm kh\xF4ng ph\u1EA3n h\u1ED3i?" } },
  "qa3_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "D\u1EEF li\u1EC7u \u1EDF \u0111\xE2u? L\xE0m th\u1EBF n\xE0o \u0111\u1EC3 s\u1EED d\u1EE5ng tr\xEAn nhi\u1EC1u m\xE1y t\xEDnh/thi\u1EBFt b\u1ECB?" } },
  "qa3_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "T\u1EA5t c\u1EA3 d\u1EEF li\u1EC7u ng\u01B0\u1EDDi d\xF9ng \u0111\u01B0\u1EE3c l\u01B0u trong tr\xECnh duy\u1EC7t c\u1EE5c b\u1ED9. N\u1EBFu b\u1EA1n c\u1EA7n s\u1EED d\u1EE5ng Type Words tr\xEAn c\xE1c thi\u1EBFt b\u1ECB ho\u1EB7c tr\xECnh duy\u1EC7t kh\xE1c nhau, b\u1EA1n c\u1EA7n xu\u1EA5t v\xE0 nh\u1EADp d\u1EEF li\u1EC7u theo c\xE1ch th\u1EE7 c\xF4ng." } },
  "qa3_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "C\xE0i \u0111\u1EB7t -> C\xE0i \u0111\u1EB7t d\u1EEF li\u1EC7u -> Xu\u1EA5t d\u1EEF li\u1EC7u tr\xEAn m\xE1y t\xEDnh g\u1ED1c -> G\u1EEDi \u0111\u1EBFn m\xE1y t\xEDnh m\u1EDBi qua ph\u1EA7n m\u1EC1m m\u1EA1ng x\xE3 h\u1ED9i -> Nh\u1EADp tr\xEAn m\xE1y t\xEDnh m\u1EDBi" } },
  "qa3_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "H\u1EC7 th\u1ED1ng t\xE0i kho\u1EA3n \u0111ang \u0111\u01B0\u1EE3c ph\xE1t tri\u1EC3n." } },
  "qa4_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Trang web t\u1EF1 \u0111\u1ED9ng l\xEAn k\u1EBF ho\u1EA1ch qu\xE1 nhi\u1EC1u t\u1EEB, l\xE0m th\u1EBF n\xE0o \u0111\u1EC3 s\u1EEDa \u0111\u1ED5i?" } },
  "qa4_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "T\u1EF7 l\u1EC7 m\u1EB7c \u0111\u1ECBnh gi\u1EEFa t\u1EEB \xF4n t\u1EADp v\xE0 t\u1EEB m\u1EDBi l\xE0 1:4." } },
  "qa4_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "B\u1EA1n c\xF3 th\u1EC3 s\u1EEDa \u0111\u1ED5i qua C\xE0i \u0111\u1EB7t -> C\xE0i \u0111\u1EB7t t\u1EEB v\u1EF1ng -> T\u1EF7 l\u1EC7 \xF4n t\u1EADp" } },
  "qa5_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "M\u1EA5t qu\xE1 nhi\u1EC1u th\u1EDDi gian \u0111\u1EC3 ho\xE0n th\xE0nh m\u1ED9t phi\xEAn h\u1ECDc, quy tr\xECnh c\xF3 qu\xE1 d\xE0i kh\xF4ng?" } },
  "qa5_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\u0110\xE2y th\u1EF1c s\u1EF1 l\xE0 m\u1ED9t v\u1EA5n \u0111\u1EC1. Quy tr\xECnh d\xE0i c\xF3 th\u1EC3 khi\u1EBFn ng\u01B0\u1EDDi ta m\u1EA5t \u0111\u1ED9ng l\u1EF1c." } },
  "qa5_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "C\xE1c t\u1EEB sai s\u1EBD \u0111\u01B0\u1EE3c l\u1EB7p l\u1EA1i. N\u1EBFu ch\u1EC9 l\xE0 l\u1ED7i \u0111\xE1nh m\xE1y, b\u1EA1n c\xF3 th\u1EC3 nh\u1EA5n Tab \u0111\u1EC3 b\u1ECF qua." } },
  "qa5_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Trong qu\xE1 tr\xECnh \xF4n t\u1EADp, ch\u1EC9 nh\u1EEFng t\u1EEB \u0111\u01B0\u1EE3c \u0111\xE1nh d\u1EA5u l\xE0 "kh\xF4ng bi\u1EBFt" m\u1EDBi y\xEAu c\u1EA7u ch\xEDnh t\u1EA3.' } },
  "qa5_q4": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Sau khi h\u1EC7 th\u1ED1ng t\xE0i kho\u1EA3n ra m\u1EAFt, t\xEDnh n\u0103ng \u0111\u01B0\u1EDDng cong tr\xED nh\u1EDB Ebbinghaus s\u1EBD \u0111\u01B0\u1EE3c th\xEAm v\xE0o." } },
  "qa6_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "T\xEDnh n\u0103ng \u0111\u01B0\u1EDDng cong tr\xED nh\u1EDB Ebbinghaus s\u1EBD \u0111\u01B0\u1EE3c th\xEAm v\xE0o kh\xF4ng?" } },
  "qa7_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "T\xF4i c\xF3 th\u1EC3 th\xEAm t\u1EEB/t\u1EEB \u0111i\u1EC3n t\xF9y ch\u1EC9nh/nh\u1EADp t\u1EEB c\u1EE7a ri\xEAng t\xF4i kh\xF4ng?" } },
  "qa7_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'C\xF3, tr\xEAn trang T\u1EEB v\u1EF1ng, nh\u1EA5p v\xE0o "T\u1EA1o t\u1EEB \u0111i\u1EC3n c\xE1 nh\xE2n"' } },
  "qa7_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Sau khi t\u1EA1o, nh\u1EA5p v\xE0o bi\u1EC3u t\u01B0\u1EE3ng "Th\xEAm t\u1EEB" \u0111\u1EC3 th\xEAm t\u1EEB c\u1EE7a ri\xEAng b\u1EA1n' } },
  "qa7_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'B\u1EA1n c\u0169ng c\xF3 th\u1EC3 nh\u1EA5p v\xE0o bi\u1EC3u t\u01B0\u1EE3ng "Nh\u1EADp" \u0111\u1EC3 nh\u1EADp h\xE0ng lo\u1EA1t' } },
  "qa8_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "T\xF4i c\xF3 th\u1EC3 th\xEAm b\xE0i vi\u1EBFt/s\xE1ch t\xF9y ch\u1EC9nh/nh\u1EADp b\xE0i vi\u1EBFt c\u1EE7a ri\xEAng t\xF4i kh\xF4ng?" } },
  "qa8_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "C\xF3, c\xE1c b\u01B0\u1EDBc v\u1EC1 c\u01A1 b\u1EA3n gi\u1ED1ng nh\u01B0 th\xEAm t\u1EEB" } },
  "qa8_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Tr\xEAn trang B\xE0i vi\u1EBFt, nh\u1EA5p v\xE0o "T\u1EA1o s\xE1ch c\xE1 nh\xE2n"' } },
  "qa8_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Sau khi t\u1EA1o, nh\u1EA5p v\xE0o n\xFAt "Qu\u1EA3n l\xFD b\xE0i vi\u1EBFt" \u1EDF tr\xEAn c\xF9ng' } },
  "qa9_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "L\xE0m th\u1EBF n\xE0o \u0111\u1EC3 t\u1EAFt \xE2m thanh ph\xEDm?" } },
  "qa9_q": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "C\xE0i \u0111\u1EB7t -> C\xE0i \u0111\u1EB7t chung -> Hi\u1EC7u \u1EE9ng \xE2m thanh -> \xC2m thanh ph\xEDm, t\u1EAFt n\xF3" } },
  "qa10_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "T\xF4i c\xF3 th\u1EC3 s\u1EED d\u1EE5ng tr\xEAn m\xE1y t\xEDnh b\u1EA3ng kh\xF4ng?" } },
