  "qa10_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Sau khi k\u1EBFt n\u1ED1i b\xE0n ph\xEDm Bluetooth, m\xE1y t\xEDnh b\u1EA3ng Android c\u1EA7n b\u1EADt th\u1EE7 c\xF4ng "Ch\u1EBF \u0111\u1ED9 m\xE1y t\xEDnh".' } },
