  "qa12_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "C\xF3 APP ho\u1EB7c ch\u01B0\u01A1ng tr\xECnh nh\u1ECF kh\xF4ng?" } },
  "qa12_q": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Kh\xF4ng, ch\u1EC9 c\xF3 trang web" } },
  "qa13_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "L\xE0m th\u1EBF n\xE0o \u0111\u1EC3 cung c\u1EA5p ph\u1EA3n h\u1ED3i cho \u0111\u1ED9i ph\xE1t tri\u1EC3n?" } },
  "qa13_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "B\u1EA1n c\xF3 th\u1EC3 tham gia nh\xF3m WeChat ch\xEDnh th\u1EE9c c\u1EE7a ch\xFAng t\xF4i, m\xF4 t\u1EA3 chi ti\u1EBFt c\xE1c t\xEDnh n\u0103ng b\u1EA1n mu\u1ED1n" } },
  "qa13_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "N\u1EBFu b\u1EA1n t\xECm th\u1EA5y l\u1ED7i trong \u1EE9ng d\u1EE5ng, vui l\xF2ng cung c\u1EA5p m\xF4 t\u1EA3 chi ti\u1EBFt v\xE0 c\xE1c b\u01B0\u1EDBc \u0111\u1EC3 t\xE1i t\u1EA1o" } },
  "qa13_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "B\u1EA1n c\u0169ng c\xF3 th\u1EC3 g\u1EEDi y\xEAu c\u1EA7u h\u1ED7 tr\u1EE3 cho ch\xFAng t\xF4i" } },
